"156101":{"id":"156101","name":"Jovens Virgens","slug":"jovens-virgens","original_title":"Virgin The Series","overview":"Quando a garota popular da escola morre misteriosamente após sua festa de 17 anos, uma colega pede a ajuda de suas amigas para filmar um documentário sobre o crime para ajudá-la a ser aceita na universidade de seus sonhos. Sua investigação revela a verdade por trás da vida perfeita que suas colegas demonstram na escola e as leva a descobrir os perigos de predadores on-line em busca de jovens virgens.","first_air_date":"2022-01-07","episode_run_time":51,"vote_average":5.4,"number_of_seasons":1,"number_of_episodes":10,"created_by":[],"production_companies":["Starvision Plus"],"genres":["Drama","Mistério"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/pr4SgkKwqod3RqAPvrPvcOvhlUQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/p4sPTt57b3ywSsKHIu8ErHOFRBx.jpg","cast":["Adhisty Zara","Lutesha","Shalom Razade","Laura Theux","Panji Zoni"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/p4sPTt57b3ywSsKHIu8ErHOFRBx.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/p4sPTt57b3ywSsKHIu8ErHOFRBx.jpg","air_date":"2022-01-07","episode_count":10,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"A Noite da Festa","overview":"Após sua festa de 17 anos, Keke, a garota mais popular da escola, é encontrada morta com suspeita de suicídio. Todos ficam chocados, e três de suas colegas, Talita, Bee e Raya, começam a especular sobre o que realmente aconteceu.","air_date":"2022-01-07","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/8OEvLIQQr2WleNO4qm8Mv3mOv4k.jpg","vote_average":0},"2":{"name":"Presentinho","overview":"Talita quer descobrir o segredo por trás da morte de Keke e pede a ajuda de sua amiga Faris para investigar. Porém, Djaya, o pai da garota e um dos maiores doadores da escola, flagra elas na casa de Keke e ameaça expulsá-la da escola. Enquanto isso, um vídeo de Keke prometendo realizar um sorteio que vai chocar a todos começa a circular.","air_date":"2022-01-14","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/HGm35qNk9n7BC8ggoALjaQuUEW.jpg","vote_average":0},"3":{"name":"Todo mundo tem um segredo","overview":"Raya revela seu relacionamento com David Jamal para Talita e Bee. Sua amizade fica mais forte. Sentindo-se amiga de Talita, Faris começa a se aproximar de Carissa. Talita, que é ciumenta, é orgulhosa demais para protestar. Enquanto isso, Senja mente para seu irmão, Hiro, sobre sair de férias e vai conhecer um cara misterioso.","air_date":"2022-01-21","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/rZ6CqkaCPvx4y2rOWQBFiRxgju1.jpg","vote_average":0},"4":{"name":"Uma versão da verdade","overview":"Talita e Faris trabalham com um hacker chamado Banyu e descobrem uma pista importante sobre a morte de Keke. Enquanto isso, Raya e Bee conseguem a confissão de David Jamal sobre suas atividades secretas. Hiro, que faz uma festa em memória de Keke, fica chocado quando a polícia chega com notícias de Senja.","air_date":"2022-01-28","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/68C1EsLG6hyEe2fMyWb47wDIz8U.jpg","vote_average":0},"5":{"name":"Consequências de uma missão","overview":"Talita e suas amigas investigam melhor a relação entre Senja e Djaya. Bee está incomodada com o relacionamento de sua mãe, Linda, com o extravagante Lukman. Wira recebe instruções especiais de Djaya, o que a coloca em apuros.","air_date":"2022-02-04","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/gNe6MInJ2gerG8W6HOqmsDOTYpv.jpg","vote_average":0},"6":{"name":"Começou em família","overview":"Talita está convencida da inocência de seu pai e promete tirar Wira da prisão. Após tudo o que aconteceu, Linda implora que Bee faça novos amigos, piorando ainda mais o relacionamento entre as duas. A investigação sobre a morte de Senja leva a polícia a suspeitar de Linda.","air_date":"2022-02-11","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/15v4sYYTLqfoEo56jBOTTdGHASA.jpg","vote_average":0},"7":{"name":"Depois da Senja","overview":"Senja luta para escapar de seu cativeiro, mas seu transtorno de estresse pós-traumático atrapalha. Hiro fica ainda mais convencido que Djaya é o namorado secreto que sequestrou Senja. Bee, feliz com Dylan, não sabe que sua vida mudará drasticamente em breve.","air_date":"2022-02-18","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/pkdUcQhRwHSUxodHpZMOzqsB7CM.jpg","vote_average":0},"8":{"name":"Quem é inocente","overview":"Na tentativa de contornar o transtorno de estresse pós-traumático de Senja para ouvir seu depoimento, a polícia traz um convidado inesperado que provoca um ataque de pânico em Senja, convencendo Hiro de que Djaya e Linda são os culpados. Bee dá uma festa de despedida de solteira para Linda, enquanto Hiro envia um vídeo surpreendente.","air_date":"2022-02-25","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/f7i5jUT0NSXe9rYm9hWqMInGXGO.jpg","vote_average":0},"9":{"name":"Alguém tem que fazer","overview":"Pronta para defender sua mãe, Bee descobre uma verdade surpreendente e decide fugir para a casa de Raya. Enquanto isso, Talita e suas amigas preparam uma armadilha para seu suspeito, mas isso coloca a vida de Talita em perigo.","air_date":"2022-03-04","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/snBF09SYZMA0QVjqT3eQVAcvBGh.jpg","vote_average":0},"10":{"name":"O último show","overview":"É hora de todos os fatos serem descobertos, quaisquer que sejam os riscos. Depois de enfrentar a derrota, Talita e suas amigas se mantêm unidas e usam as redes sociais para desmascarar o vilão. Mas será que elas pegaram a pessoa certa?","air_date":"2022-03-11","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/t5ISsbeAn7Lj3y8oBW5qOPl9vrW.jpg","vote_average":0}}}}},
