"235228":{"id":"235228","name":"Virei Vampira","slug":"virei-vampira","original_title":"I Woke Up a Vampire","overview":"No aniversário de 13 anos, Carmie descobre que é metade humana, metade vampira. E, agora com poderes míticos, a vida na escola vai ficar ainda mais complicada.","first_air_date":"2023-05-05","episode_run_time":25,"vote_average":7.4,"number_of_seasons":1,"number_of_episodes":16,"created_by":["Thomas W. Lynch"],"production_companies":["Tom Lynch Company","WildBrain"],"genres":["Comédia","Família","Sci-Fi & Fantasy","Drama"],"certification":"10","backdrop_path":"https://image.tmdb.org/t/p/original/nQQQVpEYudncIuoyD5YUzYbqulK.jpg","poster_path":"https://image.tmdb.org/t/p/original/c4MXxFdb9Z2LPtJgx7jsP8igkud.jpg","cast":["Kaileen Angelic Chang","Niko Ceci","Zebastin Borjeau","Aaliyah Cinello","Ipsita Paul"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/c4MXxFdb9Z2LPtJgx7jsP8igkud.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/c4MXxFdb9Z2LPtJgx7jsP8igkud.jpg","air_date":"2023-05-05","episode_count":16,"overview":"Carmie Henley (Kaileen Angelic Chang) é uma pré-adolescente extrovertida e autêntica que fala o que dá na telha. Além de ter que lidar com as mudanças e dilemas que fazem parte dessa fase, como a aproximação do ensino médio e paixões juvenis, ela descobre que é metade vampira e metade humana, se transformando numa Víbrida. Com a ajuda de seu amigo Kev (Niko Ceci) e dos pais, ela se esforça para se adaptar aos novos poderes, às presas e aos inimigos que acabam surgindo no meio do caminho - até os que não parecem uma ameaça à primeira vista.","vote_average":9.9,"episodes":{"1":{"name":"Piloto","overview":"Carmie acorda com novos poderes incríveis bem no dia do seu aniversário de 13 anos. Ela definitivamente não é só mais uma adolescente como qualquer outra.","air_date":"2023-05-05","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/sL5JqT2lf2kkDxayHAtujjPEGt6.jpg","vote_average":8.8},"2":{"name":"Jogo de Poder","overview":"Enquanto Dylan e o Colecionador tentam rastrear mais Híbridos, Kev vasculha os quadrinhos para descobrir o que ser uma Víbrida realmente quer dizer.","air_date":"2023-05-12","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/uYbXKW3yEirEwQBW8t5CRC5sm3H.jpg","vote_average":9.5},"3":{"name":"Espelho, Espelho Meu","overview":"Carmie se mete em problemas na hora de tirar uma foto na escola. O Colecionador se encontra com uma cliente intimidadora.","air_date":"2023-05-19","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/qihrGM7XOdW1LL71LvTvtqe6FfP.jpg","vote_average":9.8},"4":{"name":"Irmãos","overview":"Vale tudo para manter o segredo, então Carmie concorda em ser a guarda-costas de seus irmãos. Kev administra a loja de quadrinhos por um dia.","air_date":"2023-05-26","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/mApE0nl2wtIIN2zm6UA4mtXmNkg.jpg","vote_average":10},"5":{"name":"Árvore Genealógica","overview":"Kev e Carmie localizam um especialista em Híbridos. Dylan tropeça na coreografia de Leanna. A casa dos Henleys recebe visitas inesperadas.","air_date":"2023-06-02","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/tmqfFe8Iy0b844fwi7GcXp6bU0U.jpg","vote_average":10},"6":{"name":"Estreia","overview":"Rainey desapareceu, então Kev e os gêmeos procuram ajuda profissional. Carmie e Madison passam o dia juntas.","air_date":"2023-06-09","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/qJeLSxn49GZO8wAsdAlwPMMkgDf.jpg","vote_average":10},"7":{"name":"Descoberta","overview":"Só faltam mais alguns ensaios até o dia do grande show e a Metamorfa está aflita querendo a sua entrega. É pressão para tudo quanto é lado!","air_date":"2023-06-16","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/eyvfxn2Bu9eVBZB9fJvhJnifdmt.jpg","vote_average":10},"8":{"name":"O musical","overview":"Chegou a noite de estreia e é hora de Carmie brilhar, mas ninguém sabe onde ela está. Será que o show vai continuar?","air_date":"2023-06-23","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/bJrHGrrGo5EwBNZGdYRmUFjSeId.jpg","vote_average":10},"9":{"name":"Minha turma","overview":"No primeiro dia do ensino médio, Carmie atrai a atenção de um veterano chamado Tristan. Kev estreia um quadrinho com uma heróina terrivelmente familiar.","air_date":"2023-07-07","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/yjXmSdqpYvtMbYIamah4O7iSitv.jpg","vote_average":10},"10":{"name":"Novos desafios","overview":"Dylan acha que encontrou seu destino no antigo diário do avô. Carmie tenta entrar para a equipe de atletismo sem usar seus poderes.","air_date":"2023-07-14","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/rS2C2eeaixu6B89j6EXoxCnhTwp.jpg","vote_average":10},"11":{"name":"O baile","overview":"Kev e Dylan procuram um globin para traduzir uma mensagem. Leanna ajuda Carmie a se preparar para seu primeiro baile. Mas será que o parceiro dela vai aparecer?","air_date":"2023-07-21","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/74DUDHIcUiwMdcjExiW0L8HrPdT.jpg","vote_average":10},"12":{"name":"Selvagem","overview":"Em um passeio da escola, Carmie e Dylan se unem em uma caça ao tesouro valendo ingressos para um parque de diversões. Mas Carmie acaba encontrando algo inesperado.","air_date":"2023-07-28","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/sRw9YJZJfnZ0Cxjz9LMjHv4AAtQ.jpg","vote_average":10},"13":{"name":"Segredos e mentiras","overview":"Leanna muda o visual de Kev para a Fan Con. Carmie promete ajudar com o aniversário dos gêmeos, mas um encontro surpresa com Tristan toma todo o tempo dela.","air_date":"2023-08-11","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/2MwuRqmm38ChOqpJSiAclRaUljL.jpg","vote_average":10},"14":{"name":"Correndo atrás","overview":"Após uma grande briga, Carmie desconvida Dylan e Kev da competição de atletismo. Dylan decide ajudar o Colecionador a retomar a relação com a filha.","air_date":"2023-08-18","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/mUNAD6YK8yJq5D3H8T4TZTvQScy.jpg","vote_average":10},"15":{"name":"A convenção","overview":"Chegou a hora da Fan Con! Dylan procura a filha do Colecionador. Carmie fica feliz por não precisar enconder sua verdadeira identidade, mas é confundida com Carmela.","air_date":"2023-08-25","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/5E8DyL711H3r1lE87qIe4lKas4g.jpg","vote_average":10},"16":{"name":"Família reunida","overview":"Carmie descobre a identidade de sua mãe biológica e a verdade sobre uma antiga profecia. Mas será que ela pode contar com ajuda dos amigos?","air_date":"2023-09-01","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/9KmhONSPoLWpcrzlMrnsw3D4zOR.jpg","vote_average":10}}}}},
