"220524":{"id":"220524","name":"Seus Olhos","slug":"seus-olhos","original_title":"Seus Olhos","overview":"Uma série LGBTQIA+ livremente inspirada em fatos reais e conta a história do relacionamento amoroso entre Lia e Verônica. Enquanto Verônica se vê obrigada a lidar com alguns traumas, Lia mergulha em um processo de elaborar e questionar a própria identidade de gênero.","first_air_date":"2020-10-28","episode_run_time":0,"vote_average":0,"number_of_seasons":1,"number_of_episodes":7,"created_by":["Angélica di Paula"],"production_companies":["Sonan Filmes","CINEDAS"],"genres":["Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/8MIiwdxxaTax5FHDSmWK3cufSqv.jpg","poster_path":"https://image.tmdb.org/t/p/original/ixZc0LyNsUmR17tZiGdKNhZkDqh.jpg","cast":["Angélica di Paula","Lúcia Bronstein","Gabriel Lodi","Ariel Nobre","Mawusi Tulani"],"trailer":"9GSg05KD2WE","seasons":{"1":{"name":"1ª Temporada","poster_path":"https://image.tmdb.org/t/p/original/ixZc0LyNsUmR17tZiGdKNhZkDqh.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/ixZc0LyNsUmR17tZiGdKNhZkDqh.jpg","air_date":"2020-10-28","episode_count":7,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Sobre a Nossa História","overview":"Lia e Verônica vivem há 4 anos uma história de amor. Moram juntas, compartilham uma vida. Uma única decisão pode mudar tudo o que construíram.","air_date":"2020-10-28","runtime":7,"still_path":"https://image.tmdb.org/t/p/original/7qIfL8skz2gzCgOjFpsRr6NRCkb.jpg","vote_average":0},"2":{"name":"De como a Gente se Conheceu","overview":"Lia e Verônica se conhecem de um jeito inusitado. Naquele singelo encontro de olhares, algo acontece.","air_date":"2020-10-28","runtime":15,"still_path":"https://image.tmdb.org/t/p/original/muQUOdXmhoh69S6dJTIrrAzFbj5.jpg","vote_average":0},"3":{"name":"De Todos os Nossos Planos","overview":"Verônica guarda um segredo e Lia percebe que algo está errado. O que Lia nem sabe ainda, é que ela mesma também tem algo guardado.","air_date":"2020-10-28","runtime":14,"still_path":"https://image.tmdb.org/t/p/original/4lArrphdkK0JZTOE8o3KyBf7A0X.jpg","vote_average":0},"4":{"name":"Como Nossos Pais - Parte I","overview":"Depois de uma conversa difícil, algo se rompe entre Lia e Verônica. Lia decide ir passar um dia com seu pai e começa a entender que suas questões são mais profundas do que imaginava.","air_date":"2020-10-28","runtime":15,"still_path":"https://image.tmdb.org/t/p/original/y4YwvZ0kZsJESlxnURevVO5fxT0.jpg","vote_average":0},"5":{"name":"Como Nossos Pais - Parte II","overview":"Depois de uma conversa difícil, algo se rompe entre Lia e Verônica. Verônica decide ir passar um dia com sua mãe e Morena, sua ex-namorada. Morena traz à tona feridas do passado de Verônica.","air_date":"2020-10-28","runtime":13,"still_path":"https://image.tmdb.org/t/p/original/fsK2h0nc56DYICJmRy2mmtN4nZq.jpg","vote_average":0},"6":{"name":"Abismo","overview":"Lia tem um dia difícil no trabalho e Verônica confronta um trauma do passado. Em casa, entre discussões e trocas de afeto, Lia e Verônica se preparam para uma festa especial.","air_date":"2020-10-28","runtime":19,"still_path":"https://image.tmdb.org/t/p/original/ojnkH2TA6gFES4QA55TdnmcUkdg.jpg","vote_average":0},"7":{"name":"Subversão","overview":"Lia e Verônica vão a uma festa especial. Aquele espaço e aquelas pessoas impulsionam Lia a tomar um decisão difícil, que vai mudar tudo.","air_date":"2020-10-28","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/kjkfI3sxVy0KgKhWWw1yQCQF1RU.jpg","vote_average":0}}}}},
