"239748":{"id":"239748","name":"A Dinastia - New England Patriots","slug":"a-dinastia-new-england-patriots","original_title":"The Dynasty: New England Patriots","overview":"Conheça a jornada de 20 anos da franquia, desde uma química única que conquistou seis Super Bowls até o conflito interno que desencadeou uma guerra territorialista. Tom Brady, Bill Belichick, Robert Kraft e importantes jogadores revelam o caminho — e os custos — da grandiosidade.","first_air_date":"2024-02-15","episode_run_time":0,"vote_average":8.563,"number_of_seasons":1,"number_of_episodes":10,"created_by":[],"production_companies":["Imagine Documentaries","NFL Films"],"genres":["Documentário"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/bKKtaMtv9FCrXXB9rlx2y7OGZds.jpg","poster_path":"https://image.tmdb.org/t/p/original/u9W7zs3DTY233mfJJfUsmB0PInf.jpg","cast":["Tom Brady","Bill Belichick","Robert Kraft"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/nJcZhfUY3AApcKvXs2a9Vyp6vM8.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/nJcZhfUY3AApcKvXs2a9Vyp6vM8.jpg","air_date":"2024-02-15","episode_count":10,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Plano Alternativo","overview":"Após Bledsoe sofrer uma terrível lesão, Robert Kraft e Bill Belichick contam a sexta escolha da franquia no draft, Tom Brady.","air_date":"2024-02-15","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/2zESLrlcKFG5QYmh1Zb5hYAZ7JY.jpg","vote_average":0},"2":{"name":"O Bowl da Neve","overview":"Belichick surpreende o mundo ao apostar em Brady. Um confronto na neve com o Oakland Raiders redefine as possibilidades dos Patriots.","air_date":"2024-02-15","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/ncl8TuRfsuSf0QIUOEk5uzYpTxn.jpg","vote_average":0},"3":{"name":"Com os Dias Contados","overview":"Logo após o 11 de setembro, os Patriots surgem no maior palco do futebol americano e enfrentam pressões que podem uni-los — ou destruí-los.","air_date":"2024-02-22","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/k4sx3ItDtCKjHs9RwI2a9pqk1FM.jpg","vote_average":0},"4":{"name":"Spygate","overview":"Após vencer três Super Bowls, os Patriots são acusados de filmar os sinais dos técnicos adversários durantes os jogos, e as coisas começam a desmoronar.","air_date":"2024-02-22","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/xOIohSBpvPOLFCPTgDKUWTuZQai.jpg","vote_average":0},"5":{"name":"Devastado","overview":"Brady luta contra sua impermanência após uma lesão catastrófica. Belichick enfrenta desafios que testam sua liderança e lealdade.","air_date":"2024-02-29","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/e2baPGXwl4KNcjXAvWglZZB4Hfr.jpg","vote_average":0},"6":{"name":"A Qualquer Custo","overview":"Os Patriots estão em uma situação complicada e escolhem Rob Gronkowski e Aaron Hernandez no draft. Mas acontece uma tragédia e revela-se a investigação de um assassinato.","air_date":"2024-02-29","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/7FlYWFCzwSfWqcjqK0FUY28PodL.jpg","vote_average":0},"7":{"name":"Sob Pressão","overview":"A inveja e o ciúmes se consolidam, colocando Brady e os Patriots no centro de um espetáculo midiático que durou dois e ficou conhecido como Deflategate.","air_date":"2024-03-07","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/kDazhQEDaWIy7WG6SD587uHKrrm.jpg","vote_average":0},"8":{"name":"Contas a Acertar","overview":"Com Jimmy Garoppolo cada vez mais perto — e um técnico que talvez não o apoie — Brady consegue umas das maiores viradas da história do esporte.","air_date":"2024-03-07","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/51ZREVALhQArSjJsBt3amFf7C80.jpg","vote_average":0},"9":{"name":"O Ponto de Ruptura","overview":"A tensão aumenta quando Belichick toma uma decisão questionável no grande memento.","air_date":"2024-03-14","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/ljOEWbsZF7OTzt5D9z6f0alf1p0.jpg","vote_average":0},"10":{"name":"O Jogo Final","overview":"Após décadas, a dinastia se desfaz.","air_date":"2024-03-14","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/86bAT1k4BIIq6h5tjjozCasNLRQ.jpg","vote_average":0}}}}},
