"95281":{"id":"95281","name":"S.O.Z: Soldados ou Zumbis","slug":"s-o-z-soldados-ou-zumbis","original_title":"S.O.Z: Soldados o Zombies","overview":"O traficante Alonso Marroquín foge de uma prisão mexicana planejando ficar escondido. Um experimento secreto do exército americano dá errado e a unidade de elite da polícia mexicana que persegue Marroquín é contaminada, criando uma nova espécie de zumbis. O exército e os zumbis se encontram no esconderijo do chefe de cartel e uma batalha pela sobrevivência da raça humana se inicia.","first_air_date":"2021-08-06","episode_run_time":31,"vote_average":7.142,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Miguel Tejada-Flores","Nicolás Entel"],"production_companies":["Dynamo","Red Creek Productions"],"genres":["Drama","Sci-Fi & Fantasy"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/ki2V3d7DrQ79mYWvnXjTPLCgBdW.jpg","poster_path":"https://image.tmdb.org/t/p/original/arYdHX708nDq6oWNOSjw6NczWc5.jpg","cast":["Adria Morales","Sergio Peris-Mencheta","Nery Arredondo","Horacio García Rojas","Fátima Molina"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/lICAhPifWrXpscCvweCrUdCzCuG.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/lICAhPifWrXpscCvweCrUdCzCuG.jpg","air_date":"2021-08-06","episode_count":8,"overview":"N/A","vote_average":4.7,"episodes":{"1":{"name":"A Fuga","overview":"O traficante Alonso Marroquín está prestes a ser extraditado para os Estados Unidos, mas a unidade de elite da polícia, a DEA, o diretor corrupto da prisão e um cartel rival têm outros planos. Do outro lado da fronteira, em uma base secreta do exército americano, um experimento secreto obtém um resultado inesperadamente perigoso.","air_date":"2021-08-06","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/mi66MlU11SPsCSJNK0UJjcrjEGI.jpg","vote_average":8.3},"2":{"name":"O Chefe Voltou","overview":"Quando Marroquín encontra seu filho, Lucas, ele descobre que ser pai é mais difícil do que liderar um império criminoso. Becerril e sua unidade de elite percebem que subestimaram seu oponente. As consequências do experimento secreto do exército americano continuam a se multiplicar.","air_date":"2021-08-06","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/a9Ke4CYsBqHAVeDTs807V19VTOB.jpg","vote_average":0},"3":{"name":"Sem Chefes","overview":"Os planos de Snowman de expandir seus experimentos sofrem uma reviravolta inesperada. Apesar de ser despedida e ameaçada, Lilia decide seguir em frente e entrevistar o fugitivo mais perseguido do planeta. O agente da DEA, Taft, ignora sua cadeia de comando e começa uma cruzada pessoal. Enquanto isso, Lucas desobedece as ordens de seu pai.","air_date":"2021-08-06","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/hSZ7cKwobCf5YsNfJfjAMjKAhbJ.jpg","vote_average":0},"4":{"name":"Amigos e Inimigos","overview":"O exército zumbi recruta novos membros. Marroquín descobre que um de seus homens é um traidor e um novo perigo se aproxima de Lucas, que percebe que algo estranho está acontecendo. Becerril está cada vez mais próximo de seus inimigos humanos.","air_date":"2021-08-06","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/sVjmn8KgujbFzvfSNcM7PSoX0Yw.jpg","vote_average":1},"5":{"name":"O Soldado Perfeito","overview":"Quando os experimentos de Snowman com um humano contaminado fracassam, Murdoch concorda em ir atrás de mais cobaias humanas. O agente Taft descobre uma pista sobre Marroquín. Lilia escapa de um inimigo com a ajuda de Dávila.","air_date":"2021-08-06","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/6R9WxlyAK3mXkaryeN2J60vWZsF.jpg","vote_average":0},"6":{"name":"Chocolates","overview":"Um zumbi é atormentado por suas lembranças humanas. Uma missão secreta termina mal quando os Rangers do exército americano enfrentam um inimigo que parece ser imune a balas. Valencia precisa quebrar uma promessa. El Romeo é perseguido por seu próprio passado e Motosierra usa suas habilidades para capturar um monstro.","air_date":"2021-08-06","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/yaDmjLYAzNi73rUyt9uZq6YvUNh.jpg","vote_average":0},"7":{"name":"O Diabo Está à Espreita","overview":"Murdoch toma medidas extremas para conter a crise, mas Snowman tem outros planos. Dávila e Lilia enfrentam uma emboscada inesperada. A tentativa de Lucas de salvar um velho amigo o coloca em perigo, e Marroquín descobre que seus inimigos o encontraram.","air_date":"2021-08-06","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/3rjCkWXRWu02JAk7IGH3VWNDHO3.jpg","vote_average":0},"8":{"name":"Não Somos Animais","overview":"Uma épica batalha apocalíptica põe à prova todos os bandos, e velhos inimigos precisam se tornar aliados. Em menor número em relação ao exército americano, os zumbis demonstram uma inteligência surpreendente. Marroquín precisa tentar outra fuga surpreendente.","air_date":"2021-08-06","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/bjPYY4WRD6RrbKh1FCqx1jRvrXz.jpg","vote_average":0}}}}},
