"86800":{"id":"86800","name":"Planeta Hostil","slug":"planeta-hostil","original_title":"Hostile Planet","overview":"Bear Grylls apresenta a resiliência dos animais que sobrevivem em habitats extremos.","first_air_date":"2019-04-01","episode_run_time":47,"vote_average":7.5,"number_of_seasons":1,"number_of_episodes":6,"created_by":[],"production_companies":["Plimsoll Productions","National Geographic","Tencent Penguin Pictures","Cristian Dimitrius Productions"],"genres":["Documentário"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/2GD1Wxjjx5VRtXsllqmSe1bYkM7.jpg","poster_path":"https://image.tmdb.org/t/p/original/qwSklQqMX1CoUFoHZ1zkjsEC7EV.jpg","cast":["Bear Grylls"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/uCillyLIP8NujLIOvZzAvNaQwsU.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/uCillyLIP8NujLIOvZzAvNaQwsU.jpg","air_date":"2019-04-01","episode_count":6,"overview":"N/A","vote_average":8.1,"episodes":{"1":{"name":"As Montanhas Mais Altas da Terra","overview":"As montanhas mais altas da Terra são lar de leopardos-das-neves, águias-reais, cabras da montanha, gansos-de-faces-brancas e babuínos-gelada.","air_date":"2019-04-01","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/eVPbNIlkFiQYTT2nWQW7dAk2FAI.jpg","vote_average":8},"2":{"name":"Oceanos Extraordinários","overview":"Mergulhe no maior habitat da Terra, os oceanos, para descobrir um mundo de extremos extraordinários, das profundezas arrasadoras às costas turbulentas, dos vastos desertos azuis aos movimentados recifes de corais.","air_date":"2019-04-08","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/1icKnkHlmf2iTizu18fio7kC2CL.jpg","vote_average":8},"3":{"name":"Regiões Voláteis","overview":"As pradarias são algumas das regiões mais voláteis do planeta, onde os animais precisam suportar um ciclo sazonal de inundações, fome, congelamentos e incêndios.","air_date":"2019-04-15","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/nJ9htaKhzLwM50DWntimtCtBOnH.jpg","vote_average":8},"4":{"name":"Florestas Tropicais","overview":"A abundância de água, calor e luz oferece as condições perfeitas para que a vida prospere e faça das florestas tropicais as regiões de maior diversidade do planeta. Mas não se engane, pois este não é o Éden.","air_date":"2019-04-22","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/h76Ugbwp8VB8NGQglfjm8XHvsaz.jpg","vote_average":8.5},"5":{"name":"Desertos Extremos","overview":"Os habitats mais quentes do planeta, nossos desertos, estão ficando cada vez maiores, mais quentes e secos, mas um conjunto de animais incríveis ainda sobrevive nas condições mais extremas.","air_date":"2019-04-29","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/bvDN59vk8us8n9NZRqvROi5AB3D.jpg","vote_average":8},"6":{"name":"Polo Norte e Polo Sul","overview":"Entre no habitat mais frígido que a Terra conhece, os polos. Aqui, os melhores sobrevivencialistas do mundo incluem ursos polares caçadores de baleias, pinguins esquivadores de focas e uma matilha de lobos do Ártico capazes de derrubar dois bois-almiscarados.","air_date":"2019-05-06","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/sl47DRwryEqM42JFkjLgdFIU612.jpg","vote_average":8}}}}},
