"228963":{"id":"228963","name":"Barrabrava","slug":"barrabrava","original_title":"Barrabrava","overview":"Após um conflito interno violento, dois irmãos são expulsos da organizada do time de futebol para o qual torcem. Sozinhos, sem dinheiro nem proteção política, eles iniciam uma guerra que testa seus laços.","first_air_date":"2023-06-22","episode_run_time":45,"vote_average":8,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Jesús Braceras"],"production_companies":["Cimarrón Cine","Red Fish","Red Fish"],"genres":["Mistério","Drama","Crime"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/mYzSzFHWhiiyplNpw0ZycK4Zr5Z.jpg","poster_path":"https://image.tmdb.org/t/p/original/tqbHtvD89gmc8Sk1xP0gb58AAHS.jpg","cast":["Gastón Pauls","Matías Mayer","Gustavo Garzón","Liz Solari","Pablo Alarcón"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/67NGCkX3EUg5yY785cQ50zqyw1S.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/67NGCkX3EUg5yY785cQ50zqyw1S.jpg","air_date":"2023-06-22","episode_count":8,"overview":"N/A","vote_average":6.3,"episodes":{"1":{"name":"A Gangue do Tio","overview":"Enquanto luta para subir para a Primeira Divisão, o Club Atlético Libertad del Puerto recebe uma oferta milionária pela estrela do time. Tio, líder da organizada do Libertad, fará o necessário para receber sua parte.","air_date":"2023-06-22","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/2f2oWTs5ZsP9qTFM5qAYuPiTaT2.jpg","vote_average":8},"2":{"name":"A Fênix","overview":"Após a briga e a queda de Tio, os irmãos Urrutia precisam de aliados para ressurgir das cinzas.","air_date":"2023-06-22","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/ber4phMjsAFg8nBJHepJkXzj3gJ.jpg","vote_average":6},"3":{"name":"Breijart","overview":"Sem a proteção da gangue, os irmãos Urrutia precisam encontrar novas formas de se financiar. Enquanto isso, Ximi inicia sua jornada como membro da família.","air_date":"2023-06-22","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/afRGthVSLIo4wnkIKmQUyyoDfz6.jpg","vote_average":6},"4":{"name":"O Retorno","overview":"Com novos aliados, Polaco, César e a gangue decidem assumir o controle de um clube pequeno para ganhar força antes de voltar com tudo. Enquanto isso, Ximi usa o futebol para se aproximar do pai.","air_date":"2023-06-22","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/8kRe6uR5vRWcjKpsX1JgbbXqjY8.jpg","vote_average":0},"5":{"name":"Tem Coisa Aí","overview":"Com a liderança estabelecida na nova gangue, os irmãos decidem chamar a atenção do Libertad. Isto custará caro a eles, e não é o sangue de seus rivais que será derramado.","air_date":"2023-06-22","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/onOHbq5PqLGISeCE1mP8w6nGKyT.jpg","vote_average":6},"6":{"name":"Irmãos de Sangue","overview":"Com Enzo à beira da morte e após descumprir o acordo com Palacios, César é preso. Atordoada, Ximi foge, e Polaco tenta encontrar uma solução para toda a loucura.","air_date":"2023-06-22","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/d4bthlsRrv4nPVCpBRWkq0oBVAB.jpg","vote_average":6},"7":{"name":"Amor Eterno","overview":"Polaco tira o irmão da prisão a troco de algo que o afastará de César, que decide tomar uma atitude que marcará o início do fim.","air_date":"2023-06-22","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/6NSqYgDVprAa4hh9slpOwogdxFD.jpg","vote_average":6},"8":{"name":"A Promoção","overview":"Os Urrutias e a gangue de Luna finalmente se enfrentam, e o Libertad assume a cor vermelha. Quem sobreviver ficará no centro das arquibancadas.","air_date":"2023-06-22","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/m2g2xFI4CtFMtlJjUhkGxgm5KAi.jpg","vote_average":6}}}}},
