"229183":{"id":"229183","name":"Todos Amam Diamantes","slug":"todos-amam-diamantes","original_title":"Everybody Loves Diamonds","overview":"Inspirado na história real do roubo do Cento de Diamantes, a série acompanha Leonardo Notarbartolo e sua improvável gangue de ladrões enquanto eles tentam fazer \"o roubo do século\".","first_air_date":"2023-10-12","episode_run_time":0,"vote_average":6.5,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Gianluca Maria Tavarelli"],"production_companies":["Menuetto","Wildside","Amazon Studios"],"genres":["Drama","Crime","Comédia"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/WkeHNJtgEPf57yzw5vsfrL2JvZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/g1yime0F2LBsIed6DLheEU9Sizy.jpg","cast":["Kim Rossi Stuart","Anna Foglietta","Gianmarco Tognazzi","Carlotta Antonelli","Leonardo Lidi"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/g1yime0F2LBsIed6DLheEU9Sizy.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/g1yime0F2LBsIed6DLheEU9Sizy.jpg","air_date":"2023-10-12","episode_count":8,"overview":"N/A","vote_average":6.5,"episodes":{"1":{"name":"Um plano quase perfeito","overview":"A Antuérpia está em agitação: a meca impenetrável dos diamantes foi invadida. O mundo inteiro exige uma resposta. Quem teria sido tão ousado a ponto de realizar \"o roubo ano século\"? Entre os agitados clientes do Centro de Diamantes, está Leonardo Notarbartolo. Dependendo a quem se pergunta, ele é um modesto joalheiro italiano, ou o maior ladrão do mundo.","air_date":"2023-10-12","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/fWEJioa4u6iH9TjACtXnbGHOHFB.jpg","vote_average":7},"2":{"name":"O Cavalo de Tróia","overview":"Trancado em sua cela, Leonardo tenta juntar as peças do quebra-cabeça e se pergunta qual dos membros da sua equipe o traiu. Talvez seu amigo de longa data Ghigo, perito em alarmes? Ou Sandra, a arrombadora prodígio? Poderia até mesmo ser Alberto, seu meio-irmão hacker?","air_date":"2023-10-12","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/u4v8zzdUtDjOoflWI6VQ3Y9klgI.jpg","vote_average":7},"3":{"name":"O lado escuro dos diamantes","overview":"Enquanto Leonardo faz um acordo secreto com o obscuro advogado John Lovegrove, o chefe da Polícia de Diamantes, Albert Mertens, segue uma nova pista envolvendo alguém de dentro de Centro de Diamantes","air_date":"2023-10-12","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/qsaSRitWh2NIeGC11vSL7EOSn03.jpg","vote_average":7},"4":{"name":"Ladrão de Corações","overview":"Estar envolvido romanticamente com um ladrão não é fácil. Anna, a esposa de Leonardo, está bem ciente disso quando se vê encurralada por Mertens. Judith Dewitt, a diretora do Centro de Diamantes, também se arrepende de seu envolvimento com Leo quando ela se encontra na mira da investigação. Enquanto isso, um homem misterioso fica de olho em Leonardo.","air_date":"2023-10-12","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/ok1o4qTLYhWy0pdeJIMv8DprEqO.jpg","vote_average":7},"5":{"name":"O negócio","overview":"A notícia do caso extraconjugal de Leonardo atinge Anna com muita força. Anna, no entanto, não é a única a se sentir traída - existem evidências de quem traiu Leonardo.","air_date":"2023-10-12","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/ixHtK45xx0GBL6ViXv87OKcAgWP.jpg","vote_average":6},"6":{"name":"Terapia de Casais","overview":"Enquanto Mertens recebe uma dica que não pode ignorar, Anna coloca em ação seu plano de vingança, agindo para tirar a única coisa que mantém Leonardo vivo. Xeque-mate.","air_date":"2023-10-12","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/f3PCzk9c7YkBL5TxCw9RltBWesU.jpg","vote_average":6},"7":{"name":"A longa noite","overview":"Graças a uma dica, Mertens lança uma enorme operação policial. Gerald Kahn ainda está de olho em Leo.","air_date":"2023-10-12","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/aq1TVqCYUhXxcrWRQjRs1e2p40R.jpg","vote_average":6},"8":{"name":"Todos amam diamantes","overview":"Uma vez fora da prisão Leo começa a colocar as peças em movimento novamente, enquanto o resto da gangue e Gerald Kahn estão prestes a recuperar os diamantes. Todo mundo os quer. Mas o Rei dos Ladrões está livre de novo, e ele tem uma surpresa reservada para todos eles.","air_date":"2023-10-12","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/4SyhA5rjCralizs0td01WPaHztJ.jpg","vote_average":6}}}}},
