"99509":{"id":"99509","name":"Freud","slug":"freud","original_title":"Freud","overview":"Decidido a se tornar conhecido na Viena do século 19, o jovem Sigmund Freud se une a uma vidente e um detetive da polícia para resolver uma série de mistérios.","first_air_date":"2020-03-15","episode_run_time":52,"vote_average":7.173,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Marvin Kren","Stefan Brunner"],"production_companies":["Bavaria Fiction","Satel Film"],"genres":["Crime","Drama","Mistério"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/pXgwkDYoA1mjHFLrfXaXvwI3kca.jpg","poster_path":"https://image.tmdb.org/t/p/original/coW5qDTYHy5k7Akbe3QgD9qw8Dn.jpg","cast":["Manuel Ossenkopf","Robert Finster","Georg Friedrich","Ella Rumpf","Brigitte Kren"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/lWMwa2ZtO9yPUSEAGAQttVWxkpR.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/lWMwa2ZtO9yPUSEAGAQttVWxkpR.jpg","air_date":"2020-03-15","episode_count":8,"overview":"Decidido a se tornar conhecido na Viena do século 19, o jovem Sigmund Freud se une a uma vidente e um detetive da polícia para resolver uma série de mistérios.","vote_average":7.9,"episodes":{"1":{"name":"Histeria","overview":"Enfrentando obstáculos na carreira e abusando das drogas, Freud acaba envolvido em um crime terrível e numa sessão liderada por uma vidente hipnotizante.","air_date":"2020-03-15","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/bmxSVI1MXEhFlxs1rnSJrO1S3SU.jpg","vote_average":5.2},"2":{"name":"Trauma","overview":"Depois que suas teorias são criticadas, Freud ajuda as autoridades num caso de desaparecimento.","air_date":"2020-03-15","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/napE73YNBaFRwyU65Xxu7LIwUqt.jpg","vote_average":8},"3":{"name":"Sonâmbulos","overview":"Um duelo tem consequências terríveis, Sophia planta ideias fatais e Freud aprende a acessar memórias reprimidas.","air_date":"2020-03-18","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/pJqLcBI3JuRudbmhmAQgVsFcFpU.jpg","vote_average":8},"4":{"name":"Totem e tabu","overview":"Aspirações e pesadelos se tornam realidade. Freud tem um encontro com a morte. Sophia e Viktor se dão conta de seus desejos mais profundos.","air_date":"2020-03-18","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/aJ8XJJtZDtCvN2SOy9mYSFed81K.jpg","vote_average":9},"5":{"name":"Desejo","overview":"Ao despertar de um sonho terrível, Fleur parte para cima de Freud. Assassinos fecham o cerco à medida que uma onda de violência se espalha.","air_date":"2020-03-18","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/8a125TjwlRKANkTdE9OirwIYUFk.jpg","vote_average":9},"6":{"name":"Regressão","overview":"Freud investiga a morte de um pianista, e os efeitos de um trauma se revelam mais profundos do que ele imaginava. Viktor aceita um convite. Kiss confronta Heinz.","air_date":"2020-03-22","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/l1amOiRybnCUgL4HZ9raWqfWU3V.jpg","vote_average":8},"7":{"name":"Catarse","overview":"Para manter um segredo, Freud se esconde no apartamento assombrado. Uma maldição é selada e todos têm que encarar seus medos à medida que a escuridão se aproxima.","air_date":"2020-03-22","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/c49XcUaqacKHzagb2G5ggNMJqzP.jpg","vote_average":8},"8":{"name":"Supressão","overview":"Um império acaba em xeque quando um grupo interno inverte a ordem estabelecida. Quando uma porta é aberta, quem garante que ela poderá ser fechada novamente?","air_date":"2020-03-22","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/xCSn5KSgLCeflSyh6XB4tRx0CEn.jpg","vote_average":8}}}}},
